vars.getElement:
function (options) {
    if(options==undefined) {
		options = {};
    }

    w = options.w || 64;
    h = options.h || 64;
    
 
    var pane = new UIContainer();
    pane.addChild(new UIPane({fullscreen:false, fill: '0x3d3d3d', padding:0, x: 0, y: 0, w: 1, h:h}));
    pane.addChild(new UIPane({fullscreen:false, fill: '0x3d3d3d', padding:0, x: 0, y: 0, w: w, h:1}));
    pane.addChild(new UIPane({fullscreen:false, fill: '0x3d3d3d', padding:0, x: w, y: 0, w: 1, h:h}));
    pane.addChild(new UIPane({fullscreen:false, fill: '0x3d3d3d', padding:0, x: 0, y: h, w: w, h:1}));
    return pane;
    
  }
